import React from 'react'

import { DropDownContainer, DropDown } from "./drop-down.styles";

const AssetDropDown =({ assets }) => {


    
    return(
        <DropDownContainer autoFocus >
            <DropDown >
            <option text=' '/>
                {   
                    assets ? (
                        assets.map(asset => (
                    <option key={ asset.id }> { asset.id } </option> 
                    ))
                    ):(
                    <option></option>
                    )
                }
            </DropDown>
        </DropDownContainer>
    )
}


export default AssetDropDown;
